import { PaymentElement } from "@stripe/react-stripe-js";

import { CardProps } from "../types";

export const CardForm = ({ setStep }: CardProps) => {
  return (
    <form>
      <PaymentElement />
      <button onClick={() => setStep(2)}>Pay</button>
    </form>
  );
};
